import React from "react";
import { ArrowLeft } from "lucide-react";

const OrderHistory = () => {
  return (
    <div>
      <h2>Order History</h2>
      <button onClick={() => setShowOrders(false)} variant="outline">
        <ArrowLeft />
        Back to Menu
      </button>
      <ul>
        {orders.map((order, index) => (
          <li key={index}>
            {order.title} - ${order.price}
          </li>
        ))}
      </ul>
    </div>
  );
};
export default OrderHistory;
